    <title>Happy Lantern Festive</title>
    <style>
        #right1{
            visibility: hidden;
        }
        #bottom2{
            visibility: hidden;
        }
        #left1{
            visibility: hidden;
        }
        #smalldishes{
            visibility: hidden;
        }
        #bottom1{
            visibility: hidden;
        }
        #rice{
            visibility: hidden;
        }
        #fork{
            visibility: hidden;
        }
        #topdishes{
            position: fixed;
            display: none;
            animation: translate 2s;
            transform: translate(10);
            animation-name: t1;
            animation-direction: normal;
        }
        @keyframes t1 {
            0%{transform: translateY(-200px);}
            100%{transform: translateY(0px);}
        }
        #bottom3{
            visibility: hidden;
        }
        #middle{
            visibility: hidden;
        }
        #middledishes{
            display: none;
            transform-origin: 50% center;
            position: fixed;
            animation-name: rotating;
            animation-duration: 2.5s;
            animation-play-state: running;
            animation-timing-function: ease-out;
        }
        
        @-webkit-keyframes rotating {
        from { -webkit-transform: rotate(0deg); }
        to { -webkit-transform: rotate(360deg); }
        }
        #bottomdishes{
            position: fixed;
            display: none;
            animation: translate 2.5s;
            transform: translate(10);
            animation-name: t2;
            animation-direction: normal;
        }
        @keyframes t2 {
            0%{transform: translateX(-750px);}
            100%{transform: translateX(0px);}
        }
    </style>

    <script>
        var object = document.getElementById("object");
        var bdishes = document.getElementById("bottomdishes");
        var mdishes = document.getElementById("middledishes");
        var middle = document.getElementById("middle");
        var bottom3 = document.getElementById("bottom3");
        var tdishes = document.getElementById("topdishes");
        var fork = document.getElementById("fork");
        var rice = document.getElementById("rice");
        var bottom1 = document.getElementById("bottom1");
        var sdishes = document.getElementById("smalldishes");
        var left1 = document.getElementById("left1");
        var bottom2 = document.getElementById("bottom2");
        var right1 = document.getElementById("right1");
        
        object.addEventListener("click", function () {
            mdishes.style.display = "inline";
        }); 
        
        mdishes.addEventListener("click", function () {
            tdishes.style.display = "inline";
        });
        
        tdishes.addEventListener("click", function () {
            bdishes.style.display = "inline";
        });
        
        bdishes.addEventListener("click", function () {
            sdishes.style.visibility = "visible";
        });
        
        sdishes.addEventListener("click", function () {
            middle.style.visibility = "visible";
            left1.style.visibility = "visible";
            right1.style.visibility = "visible";
            bottom1.style.visibility = "visible";
            bottom2.style.visibility = "visible";
            bottom3.style.visibility = "visible";
        });
        
        middle.addEventListener("click", function () {
            fork.style.visibility = "visible";
        });
        
        fork.addEventListener("click", function () {
            rice.style.visibility = "visible";
        });
        
        var msg = false;
        rice.addEventListener("click", function () {
        
        if (msg == false){
        var text1 = document.createElement("img");
        text1.src = "f10.svg";
        text1.style.position = "fixed";
        text1.style.bottom = "0";
        text1.style.top = "0";
        text1.style.left = "0";
        text1.style.right = "0";
        text1.style.margin = "auto";
        document.body.appendChild(text1);
        msg = true;
            
        text1.addEventListener("click", function(){
            document.body.removeChild(text1);
        })
        }
    });
        
       
        bottom3.addEventListener("click", function () {
            window.location = "Fourth.html";
        });
        </script>
